import Layout from '../components/layout';
import ItemInstance from '../models/iteminstance';
import CartInstances from '../components/CartInstances';
import { useInstance, useInstanceDispatch } from './contexts/CartContext';
import { useUser } from './contexts/userContext';
import { useEffect } from 'react';

export default function Cart() {
  var iteminstances = [''];
  console.log('iteminstances: ', iteminstances);
  const state = useInstance();
  const dispatch = useInstanceDispatch();
  const user = useUser();

  const getAllcarts = (event) =>
    dispatch({
      type: 'GETALL',
      payload: items,
    });

  useEffect(() => {
    getAllcarts();
  }, [iteminstances]);

  //useEffect();

  return (
    <Layout>
      {/* Create a card for each item */}
      <div className='card-columns'>
        {iteminstances &&
          iteminstances.map((iteminstance) => (
            <CartInstances iteminstance={iteminstance} key={iteminstance._id} />
          ))}{' '}
        {!iteminstances && <div>No items</div>}
      </div>
    </Layout>
  );
}
